import logo from './logo.svg';
import './App.css';
import Home from './routes/Home.js';
import Detail from './routes/Detail';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  //Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/'>
          <Home />
        </Route>
        <Route path='/detail'>
          <Detail />
        </Route>
      </Switch>
    </Router>);
}

export default App;
